const InitialState = {
    test2: null
}
export const testReducer = (state=InitialState,action) => {
    debugger
    switch (action.type) {
        case 'TEST': {
            return {
                ...state,
                test2: action.test2,
            }

        }

        default:
            return state
    }
}


export const testAC = (test2) => ({type:'TEST',test2});
